import React, { useState } from "react";
import { Canvas } from "@react-three/fiber";
import { OrbitControls } from "@react-three/drei";
import "./app.scss";
import Backpack from "./component/Backpack";

export default function App() {
  const body_colors = {
    Brown: "#8B4512",
    Black: "#1A1A1A",
    Blue: "#104D97",
  };
  const metal_colors = {
    Silver: "/metal-color/silver.png",
    Gold: "/metal-color/gold.png",
    Black: "/metal-color/black.png",
  };
  // denim / fabric / leather / metall / strap

  const materials = {
    denim: "denim",
    fabric: "fabric",
    leather: "leather",
    metall: "metall",
    strap: "strap",
  };
  // const materials = {
  //   denim: ["/textures/denim_normal.jpg","/textures/denim_occlusionRoughnessMetallic.jpg"],
  //   fabric: ["/textures/fabric_normal.jpg","/textures/fabric_occlusionRoughnessMetallic.jpg"],
  //   leather: ["/textures/leather_normal.jpg","/textures/leather_occlusionRoughnessMetallic.jpg"],
  //   metall: ["/textures/metall_normal.jpg","/textures/metall_occlusionRoughnessMetallic.jpg"],
  //   strap: ["/textures/strap_normal.jpg","/textures/strap_occlusionRoughnessMetallic.jpg"],
  // };
  const [bodyColor, setBodyColor] = useState(body_colors.Brown);
  const [material, setMaterial] = useState(materials.denim);
  const [metalColor, setMetalColor] = useState(metal_colors.Silver);

  const handleColorChange = (color) => {
    setBodyColor(body_colors[color]);
  };

  const handleMetalColorChange = (color) => {
    setMetalColor(color);
  };

  const handleMaterialChange = (color) => {
    setMaterial(color);
  };

  return (
    <div className="body">
      <Canvas
        camera={{ position: [0, 2, 10], fov: 50 }}
        style={{ height: "100vh", width: "100vw" }}
      >
        <ambientLight
          intensity={0.5}
          color={"#fff"}
        />
        <directionalLight
          position={[10, 10, 10]}
          intensity={1}
          color={"#fff"}
        />
        <Backpack
          bodyColor={bodyColor}
          material={material}
          metalColor={metalColor}
        />
        <OrbitControls />
      </Canvas>

      <div className="variosity">
        <div className="block">
          <div className="block--title">
            <p>BODY COLOR</p>
          </div>

          <hr></hr>

          <div className="body-color">
            {Object.keys(body_colors).map((body, index) => (
              <div
                className="body-color--change"
                key={index}
                onClick={() => handleColorChange(body)}
              >
                <button
                  className={`body-color--change__button ${
                    bodyColor === body_colors[body] ? "active" : ""
                  }`}
                >
                  <div
                    className={`body-color--change__background`}
                    style={{ backgroundColor: body_colors[body] }}
                  ></div>
                </button>

                <p
                  className={`body-color--change__text ${
                    bodyColor === body_colors[body] ? "active" : ""
                  }`}
                >
                  {body}
                </p>
              </div>
            ))}
          </div>
        </div>

        <div className="block">
          <div className="block--title">
            <p>METAL COLOR</p>
          </div>

          <hr></hr>

          <div className="body-color">
            {Object.keys(metal_colors).map((body, index) => (
              <div
                className="body-color--change"
                key={index}
                onClick={() => handleMetalColorChange(metal_colors[body])}
              >
                <button
                  className={`body-color--change__button ${
                    metalColor === metal_colors[body] ? "active" : ""
                  }`}
                >
                  <div
                    className={`body-color--change__background`}
                    style={{ backgroundImage: `url(${metal_colors[body]})` }}
                  ></div>
                </button>

                <p
                  className={`body-color--change__text ${
                    metalColor === metal_colors[body] ? "active" : ""
                  }`}
                >
                  {body}
                </p>
              </div>
            ))}
          </div>
        </div>

        <div className="material">
          <div className="material--title">
            <p>MATERIAL</p>
          </div>

          <hr></hr>
          <button>denim</button>
          <button>fabric</button>
          <button>leather</button>
          <button>metall</button>
          <button>strap</button>
        </div>
      </div>
    </div>
  );
}
